  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Our nation is in the midst of an unprecedented
  investment in IT to support healthcare delivery. The centerpiece of the 2009 Health
  Information Technology for Economic and Clinical Health (HITECH) Act is 30 billion
  dollars in incentives for doctors and hospitals to become meaningful users of electronic
  health records. The hope is that EHRs will enable better management of information
  in order to improve the quality and reduce the cost of health care.</p>n\",\n\t\"license_title\":
